export var setCenturyPage = function (v) {
    var year = Number(v.split('-')[0]);
    return Math.ceil(year / 100);
};
export var setDecadePage = function (v) {
    var year = Number(v.split('-')[0]);
    return Math.ceil(year / 10);
};
export var setYearPage = function (v) {
    var year = Number(v.split('-')[0]);
    return year;
};
export var setMonthPage = function (v) {
    var year = Number(v.split('-')[0]);
    var month = Number(v.split('-')[1]);
    return (year - 1) * 12 + month;
};
